import React from 'react'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Redirect,
} from "react-router-dom";

import Dachboard from './Dachboard';
import Home from './app/Home/Home';
import LandingPage from './app/Login/LandingPage';
import LoadingBar from 'react-redux-loading-bar'

function App(props) {
    // useEffect(() => {
    //     localStorage.removeItem('persist:root')
    // }, [])
    return (
        <>
            <LoadingBar style={{ background: "#E5017D", zIndex: 99, position: "fixed"}} />
            <Router>
                <Switch>


                    <Route path="/dashboard">
                        <Home />
                    </Route>
                    
                    <Route path="/">
                        <LandingPage />
                    </Route>


                    {/* <Route path="/dachboard">
                        {
                            localStorage.getItem("authtoken") ?
                                <Dachboard />
                                :
                                <Redirect to="/" />

                        }
                    </Route>


                    <Route path="/">
                        {localStorage.getItem("authtoken") ?
                            <Redirect to="/dachboard" />
                            :
                            <LandingPage />
                        }
                    </Route> */}

                </Switch>
            </Router>
        </>
    )
}

export default App;

